//Ventuno Socket Library ver.1.0.0.6
if( typeof VTNSocket == 'undefined' ){
	var VTNSocket = function(){
		this.setUp();
	};
	VTNSocket.prototype = {
		SOCKET_LIB:vtnJSGC.CDN_path+'js/socket.io.js',
		START_AD:'StartAd',
		RESUME_LIVE:'ResumeLive',
		io:'',socket:'',readyListener:'',startAdListener:'',resumeLiveListener:'',
		setUp:function(){
			var t = this;
			if( !t.io ){
				VTN_loadFilesASync([t.SOCKET_LIB], 0, function() {
					t.io = io;
					if( t.io && t.readyListener ) t.readyListener();
				});
			};
		},
		connect:function( _videoID, _url ){
			var t = this;
			t.socket = t.io.connect( _url );
			t.socket.emit('assign_id', _videoID );
			t.socket.on('exec_command', function ( _rVal ) {
				var rVal = JSON.parse( _rVal ), dateTime = (rVal['datetime'])?rVal['datetime'].toString():'';
				if( rVal['command'] == t.START_AD && t.startAdListener ) t.startAdListener( dateTime );
				if( rVal['command'] == t.RESUME_LIVE && t.resumeLiveListener ) t.resumeLiveListener( dateTime );
			});
			t.socket.on('process_schedules', function ( _schedules ) {
				if( t.updateScheduleListener ) t.updateScheduleListener( _schedules );
			});
		},
		//listners
		onReady:function( _callBack ){
			var t = this;
			if( _callBack ) t.readyListener = _callBack;
			if( t.io && t.readyListener ) t.readyListener();
		},
		onStartAd:function( _callBack ){
			var t = this;
			if( _callBack ) t.startAdListener = _callBack;
		},
		onResumeLive:function( _callBack ){
			var t = this;
			if( _callBack ) t.resumeLiveListener = _callBack;
		},
		onUpdateSchedule:function( _callBack ){
			var t = this;
			if( _callBack ) t.updateScheduleListener = _callBack;
		},
		//off
		off:function(){
			var t = this;
			t.readyListener = null;
			t.startAdListener = null;
			t.resumeLiveListener = null;
			t.updateScheduleListener = null;
		},
		//destory
		destory:function(){
			var t = this;
			if( t.socket ){
				t.socket.removeAllListeners('exec_command');
				t.socket.removeAllListeners('process_schedules');
			}
			t.off();
		}
	};
	var VTNFlashSocketConnect = function( _flashObj, _url, _videoID ){
		var t = this;
		t.socket = new VTNSocket();
		t.socket.onStartAd( function( _dateTime ){	_flashObj.startAdBreak( _dateTime ); });
		t.socket.onResumeLive( function( _dateTime ){ _flashObj.resumeStream( _dateTime ); });
		t.socket.onUpdateSchedule( function( _schedules ){ _flashObj.updateSchedule( _schedules ) });
		t.socket.onReady( function(){
			t.socket.connect( _videoID, _url );
			//t.socket
		});
	};
	//flash wrapper 
	var connect_to_ad_scheduler = function ( _url, _videoID, _objID ){
		var flashObj = vtnU.D$(_objID),
		flashConnect = ( flashObj )? new VTNFlashSocketConnect( flashObj, _url, _videoID ):'';
	};
};

